import React, { useState } from 'react';
import axiosInstance from '../utils/axiosInstance';
import { useAuth } from '../contexts/AuthContext';
import { Alert, AlertDescription, AlertTitle } from '@/components/ui/alert';
import { AlertDialog, AlertDialogAction, AlertDialogCancel, AlertDialogContent, AlertDialogDescription, AlertDialogFooter, AlertDialogHeader, AlertDialogTitle, AlertDialogTrigger } from '@/components/ui/alert-dialog';

const AccountTab = ({ profile, onAccountUpdate }) => {
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const { logout } = useAuth();

  const handleCancelSubscription = async () => {
    setIsLoading(true);
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/api/subscription/cancel');
      setSuccess(`Your subscription has been cancelled. You will have access to premium features until ${new Date(response.data.cancelAt).toLocaleDateString()}.`);
      onAccountUpdate(); // Refresh the profile data
    } catch (err) {
      setError('Failed to cancel subscription. Please try again.');
      console.error('Error cancelling subscription:', err);
    } finally {
      setIsLoading(false);
    }
  };

  const renderSubscriptionDetails = () => (
    <div className="space-y-2">
      <p><strong>Subscription Tier:</strong> {profile.subscriptionTier}</p>
      <p><strong>Subscription Status:</strong> {profile.subscriptionActive ? 'Active' : 'Inactive'}</p>
      {profile.subscriptionEndDate && (
        <p><strong>Subscription End Date:</strong> {new Date(profile.subscriptionEndDate).toLocaleDateString()}</p>
      )}
    </div>
  );

  const renderCancelButton = () => (
    <AlertDialog>
      <AlertDialogTrigger asChild>
        <button
          className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700 disabled:opacity-50"
          disabled={isLoading}
        >
          {isLoading ? 'Processing...' : 'Cancel Subscription'}
        </button>
      </AlertDialogTrigger>
      <AlertDialogContent>
        <AlertDialogHeader>
          <AlertDialogTitle>Are you sure you want to cancel?</AlertDialogTitle>
          <AlertDialogDescription>
            Your subscription will be cancelled at the end of the current billing cycle. You will continue to have access to premium features until then.
          </AlertDialogDescription>
        </AlertDialogHeader>
        <AlertDialogFooter>
          <AlertDialogCancel>No, keep my subscription</AlertDialogCancel>
          <AlertDialogAction onClick={handleCancelSubscription}>
            Yes, cancel at end of billing cycle
          </AlertDialogAction>
        </AlertDialogFooter>
      </AlertDialogContent>
    </AlertDialog>
  );

  return (
    <div className="space-y-6">
      <h2 className="text-2xl font-bold">Account Details</h2>
      {renderSubscriptionDetails()}
      
      {profile.subscriptionActive && !profile.cancellationRequested && renderCancelButton()}

      {profile.cancellationRequested && (
        <Alert>
          <AlertTitle>Subscription Cancellation Requested</AlertTitle>
          <AlertDescription>
            Your subscription will end on {new Date(profile.subscriptionEndDate).toLocaleDateString()}. You will continue to have access to premium features until then.
          </AlertDescription>
        </Alert>
      )}
      
      {error && (
        <Alert variant="destructive">
          <AlertTitle>Error</AlertTitle>
          <AlertDescription>{error}</AlertDescription>
        </Alert>
      )}

      {success && (
        <Alert>
          <AlertTitle>Success</AlertTitle>
          <AlertDescription>{success}</AlertDescription>
        </Alert>
      )}
      
      <div className="mt-8">
        <h3 className="text-xl font-semibold mb-4">Danger Zone</h3>
        <AlertDialog>
          <AlertDialogTrigger asChild>
            <button className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700">
              Delete Account
            </button>
          </AlertDialogTrigger>
          <AlertDialogContent>
            <AlertDialogHeader>
              <AlertDialogTitle>Are you absolutely sure?</AlertDialogTitle>
              <AlertDialogDescription>
                This action cannot be undone. This will permanently delete your account and remove your data from our servers.
              </AlertDialogDescription>
            </AlertDialogHeader>
            <AlertDialogFooter>
              <AlertDialogCancel>Cancel</AlertDialogCancel>
              <AlertDialogAction onClick={() => {/* Implement account deletion logic */}}>
                Delete Account
              </AlertDialogAction>
            </AlertDialogFooter>
          </AlertDialogContent>
        </AlertDialog>
      </div>
    </div>
  );
};

export default AccountTab;
